import React, { Component } from "react";
import "@material-ui/core";
import {
  List,
  ListItem,
  ListItemText,
  Card,
  CardContent,
  Typography,
} from "@material-ui/core";

import "./App.css";
import logo from "./logo.png";
import Twitts from "./Twitts";
import Charts from "./Charts";
import { Redirect } from "react-router-dom";

function App() {
  const nevigateTo = () => {
    return <Redirect to="./Twitts.js" />;
  };
  return (
    <div className="app">
      <div className="landing_page">landing page</div>
      <div className="app_left">
        <img src={logo} style={{ display: "flex", width: "100%" }}></img>
        <div className="navigation">
          <List>
            {["HOME", "CDU", "SPD", "AFD", "FDP", "LINKE", "GRÜN"].map(
              (text) => (
                <ListItem button key={text} onClick={nevigateTo}>
                  <ListItemText primary={text} className="list" />
                </ListItem>
              )
            )}
          </List>
        </div>
      </div>

      <div className="app_right"></div>
    </div>
  );
}

export default App;
